glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in vec4 a_color;
out vec4 v_color;
#if USE_TEXTURE
in vec2 a_uv0;
out vec2 v_uv0;
#endif
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  #if USE_TEXTURE
  v_uv0 = a_uv0;
  #endif
  v_color = a_color;
  gl_Position = pos;
}

glsl3.frag:
precision highp float;
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
in vec4 v_color;
#if USE_TEXTURE
in vec2 v_uv0;
#endif
uniform sampler2D texture;
uniform sampler2D u_content_texture;
uniform sampler2D u_glow_texture;
uniform PROPERTIES {
  float u_scalar_x;
  float u_scalar_y;
  float u_offset_x;
  float u_offset_y;
  float u_mouse_x;
  float u_mouse_y;
  float u_resolution_x;
  float u_resolution_y;
  float u_entry_point_x;
  float u_entry_point_y;
  float u_time;
  float u_glint_on;
  float u_is_flip;
  float u_is_horizontal;
};
const vec2 aspectRatio = vec2(9.0, 16.0);
float CalculateY(float x, vec2 line){
    return (x * line.x) + line.y;
}
float Distance(vec2 pos, vec2 line){
    return abs(line.x * pos.x - pos.y + line.y) / sqrt(line.x * line.x + 1.0);
}
vec2 Reflection(vec2 pos, vec2 line){
    float d = (pos.x + (pos.y - line.y) * line.x) / (1.0 + line.x * line.x);
    return vec2(2.0 * d - pos.x, 2.0 * d * line.x - pos.y + 2.0 * line.y);
}
float Sigmoid(float x){
    return ((x) / (1.0 + abs(x)));
}
vec4 GetTextureScaled(sampler2D sampler, vec2 p){
    vec2 a = vec2(p.x / 9.0, p.y / 16.0);
    return texture2D(sampler, a);
}
vec4 GetTextureScaledFromAtlas(sampler2D sampler, vec2 p){
    vec2 a = vec2(p.x / 9.0 / u_scalar_x + u_offset_x, p.y / 16.0 / u_scalar_y + u_offset_y);
    return texture2D(sampler, a);
}
vec2 CalculateLine(){
      vec2 mouse = vec2(u_mouse_x, u_mouse_y);
      mouse.x = mouse.x / u_resolution_x * aspectRatio.x;
      mouse.y = mouse.y / u_resolution_y * aspectRatio.y;
      float dx = mouse.x - u_entry_point_x;
      float dy = mouse.y - u_entry_point_y;
      float m = -(mouse.x - u_entry_point_x) / (mouse.y - u_entry_point_y);
      vec2 mid = vec2(u_entry_point_x + (dx / 2.0), u_entry_point_y + (dy / 2.0));
      vec2 line = vec2(m, ((-m * mid.x) + mid.y));
      return line;
}
vec4 Glint(vec2 pos){
    float speed = 0.28;
    float linewidth = 0.58;
    float grad = 3.0;
    vec4 col1 = vec4(0.05, 0.05, 0.05, 0.2);
    vec4 col2 = vec4(0.1, 0.1, 0.1, 0.2);
    vec2 linepos;
    if(u_is_horizontal == 1.0){
        linepos = vec2(pos.y / 16.0, pos.x / 9.0);
    }
    else{
        linepos = vec2(pos.x / 9.0, pos.y / 16.0);
    }
    linepos.x = linepos.x / 2.0;
    linepos.y = -linepos.y - mod(u_time * speed, 2.0) + 1.5;
    float y = -linepos.y * grad;
    float s = smoothstep(y - linewidth, y, linepos.y) - smoothstep(y, y + linewidth, linepos.y);
    return ((s * col1) + (s * col2));
}
void mainImage(out vec4 fragColor, in vec2 fragCoord){
      vec2 pos = v_uv0.xy;
      pos.x = pos.x * aspectRatio.x * 4.0 - 13.5;
      pos.y = pos.y * aspectRatio.y * 4.0 - 24.0;
      vec2 line = CalculateLine();
      float ye = CalculateY(u_entry_point_x, line);
      float yp = CalculateY(pos.x, line);
      vec4 color = vec4(1.0, 0.0, 0.0, 0.0);
      if(pos.y > yp == u_entry_point_y > ye){
          color = vec4(0.0, 0.0, 0.0, 0.0);
      }
      else{
          if(u_is_flip == 0.0){
              vec4 backColor = GetTextureScaled(texture, pos.xy);
              vec2 ref = Reflection(pos, line);
              ref.y = 16.0 - ref.y;
              float yr = CalculateY(ref.x, line);
              float d = clamp(0.7 - Sigmoid(Distance(pos, line)) * 1.8, 0.0, 3.0);
             if(ref.x >= 0.0 && ref.x <= 9.0 && ref.y >= 0.0 && ref.y <= 16.0){
                vec4 faceColor = GetTextureScaled(texture, ref.xy);
                vec4 contentColor = GetTextureScaledFromAtlas(u_content_texture, ref.xy);
                if(faceColor.w < 1.0){
                    color = backColor;
                }
                else if(ref.x <= 1.5 || ref.x >= 7.5 || ref.y <= 1.3 || ref.y >= 14.7 || contentColor.w < 0.5){
                    color = vec4(1.0, 1.0, 1.0, 1.0);
                }
                else{
                    color = contentColor;
                }
              }
              else{
                  vec4 glowColor = GetTextureScaled(u_glow_texture, pos.xy);
                  if(glowColor.w > 0.0 && backColor.w > 0.0 && u_glint_on == 1.0){
                      vec4 glintColor = Glint(pos.xy);
                      color = backColor + glintColor;
                  }
                  else{
                      color = backColor;
                  }
              }
              color.xyz = color.xyz - d;
         }
          else{
              vec4 faceColor = GetTextureScaled(texture, pos.xy);
              vec4 contentColor = GetTextureScaledFromAtlas(u_content_texture, pos.xy);
              if(faceColor.w > 0.0){
                  color = contentColor;
              }
          }
      }
     fragColor = color;
}
void main () {
  mainImage(gl_FragColor, gl_FragCoord.xy);
}

